import React from 'react';
import styled from 'styled-components';

const Styles = styled.div`

background: #eeeeee;
height: 30vw;
`

function Footer() {
   return (
   <Styles>
     <h1>Footer</h1>
   </Styles>
   );
    
    
   
}

export default Footer;
